import React from 'react';
import { Typography } from '@material-ui/core';

const AdminDashboard = () => {
  return (
    <>
      <Typography variant="h6" gutterBottom>
        Admin Dashboard
      </Typography>
      {/* Add admin dashboard content here */}
    </>
  );
};

export default AdminDashboard;
